import { Dialog, DialogContent, DialogContentText, DialogTitle, IconButton, TextField } from "@mui/material"
import CloseIcon from '@mui/icons-material/Close';
import { useNavigate } from "react-router";


export const VerifyEmail = () => {

    const nav = useNavigate()

    return (
        <>
            <Dialog open={true}
                id="DialogVerifyEmail"
            >
                <DialogTitle id="closeDialog">
                    <IconButton className="roundButton" onClick={() => nav("../")} ><CloseIcon /></IconButton>
                    <DialogContentText id="VerifyEmail">אימות</DialogContentText>
                </DialogTitle>
                <DialogContent id="DialogVerifyEmailContent">

                    <p>ברגעים אלו נשלח לכתובת האימייל שלך קוד, אנא הקש אותו כאן</p>
                    <TextField variant="standard" className="verifyEmailInputs"></TextField>
                    <TextField variant="standard" className="verifyEmailInputs"></TextField>
                    <TextField variant="standard" className="verifyEmailInputs"></TextField>
                    <TextField className="verifyEmailInputs"></TextField>
                    <TextField className="verifyEmailInputs"></TextField>
                    <TextField className="verifyEmailInputs"></TextField>
                </DialogContent>
            </Dialog>        </>
    )
}
